import React, { useState, useEffect } from 'react';
import { motion, useScroll, useTransform } from 'framer-motion';
import './Header.css';

const Header = ({ currentPage, onNavigate, darkMode, toggleDarkMode }) => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [hoveredItem, setHoveredItem] = useState(null);
  const { scrollY } = useScroll();
  
  const headerOpacity = useTransform(scrollY, [0, 100], [0.95, 1]);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navItems = [
    { id: 'home', label: 'Home', icon: '🏠', color: '#81c784' },
    { id: 'identification', label: 'Identify', icon: '🔍', color: '#64b5f6' },
    { id: 'local-rules', label: 'Local Rules', icon: '📋', color: '#ffb74d' },
    { id: 'upcycling', label: 'Upcycling', icon: '♻️', color: '#4db6ac' },
  ];

  return (
    <motion.header 
      className={`header ${isScrolled ? 'scrolled' : ''}`}
      style={{ opacity: headerOpacity }}
    >
      <div className="container">
        <div className="header-content">
          {/* Enhanced Large Logo */}
          <motion.div
            className="logo"
            onClick={() => onNavigate('home')}
            initial={{ opacity: 0, x: -30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, type: 'spring' }}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <motion.div className="logo-icon-wrapper">
              <motion.span 
                className="logo-icon"
                animate={{ 
                  rotate: [0, 360],
                }}
                transition={{ 
                  duration: 10, 
                  repeat: Infinity, 
                  ease: "linear" 
                }}
                whileHover={{ 
                  scale: 1.3, 
                  rotate: 0,
                  transition: { duration: 0.3 }
                }}
              >
                🌱
              </motion.span>
              <motion.div
                className="logo-glow"
                animate={{
                  scale: [1, 1.2, 1],
                  opacity: [0.3, 0.6, 0.3]
                }}
                transition={{
                  duration: 2,
                  repeat: Infinity,
                  ease: "easeInOut"
                }}
              />
            </motion.div>
            
            <div className="logo-text">
              <motion.h1
                initial={{ opacity: 0, y: -10 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.3, duration: 0.5 }}
              >
                <span className="logo-word smart">Smart</span>
                <span className="logo-word eco">Eco</span>
                <span className="logo-word dispose">dispose</span>
              </motion.h1>
              <motion.p
                className="logo-tagline"
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ delay: 0.5 }}
              >
                Recycle Smarter, Live Greener
              </motion.p>
            </div>
          </motion.div>

          {/* Navigation with Larger Text */}
          <motion.div
            className="nav-wrapper"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.5, delay: 0.2 }}
          >
            <nav className="nav">
              {navItems.map((item, index) => (
                <motion.button
                  key={item.id}
                  className={`nav-btn ${currentPage === item.id ? 'active' : ''}`}
                  onClick={() => onNavigate(item.id)}
                  onMouseEnter={() => setHoveredItem(item.id)}
                  onMouseLeave={() => setHoveredItem(null)}
                  initial={{ opacity: 0, y: -20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.3, delay: index * 0.1 }}
                  whileHover={{ 
                    scale: 1.08,
                    y: -5,
                  }}
                  whileTap={{ scale: 0.95 }}
                  style={{
                    boxShadow: hoveredItem === item.id 
                      ? `0 10px 30px ${item.color}40` 
                      : '0 4px 15px rgba(0, 0, 0, 0.1)'
                  }}
                >
                  <motion.span 
                    className="nav-icon"
                    animate={{
                      scale: hoveredItem === item.id ? 1.4 : 1,
                      rotate: hoveredItem === item.id ? 10 : 0
                    }}
                    transition={{ duration: 0.3 }}
                  >
                    {item.icon}
                  </motion.span>
                  <span className="nav-label">{item.label}</span>
                  
                  {/* Animated background on hover */}
                  <motion.div
                    className="nav-btn-bg"
                    initial={{ opacity: 0 }}
                    animate={{ 
                      opacity: hoveredItem === item.id ? 1 : 0,
                    }}
                    style={{ backgroundColor: item.color }}
                  />
                  
                  {/* Active indicator */}
                  {currentPage === item.id && (
                    <motion.div
                      className="active-indicator"
                      layoutId="activeIndicator"
                      initial={{ opacity: 0 }}
                      animate={{ opacity: 1 }}
                      transition={{ duration: 0.3 }}
                      style={{ backgroundColor: item.color }}
                    />
                  )}
                </motion.button>
              ))}
            </nav>

            {/* Theme Toggle with Enhanced Animation */}
            <motion.button
              className="theme-toggle"
              onClick={toggleDarkMode}
              whileHover={{ 
                scale: 1.2,
                rotate: 180,
              }}
              whileTap={{ scale: 0.9 }}
              transition={{ duration: 0.3 }}
              initial={{ opacity: 0, rotate: -180 }}
              animate={{ opacity: 1, rotate: 0 }}
            >
              <motion.span
                key={darkMode ? 'moon' : 'sun'}
                initial={{ rotate: 90, opacity: 0, scale: 0.5 }}
                animate={{ rotate: 0, opacity: 1, scale: 1 }}
                exit={{ rotate: -90, opacity: 0, scale: 0.5 }}
                transition={{ duration: 0.4 }}
              >
                {darkMode ? '🌙' : '☀️'}
              </motion.span>
              
              {/* Ripple effect on click */}
              <motion.div
                className="theme-toggle-ripple"
                initial={{ scale: 0, opacity: 1 }}
                animate={{ scale: 2, opacity: 0 }}
                transition={{ duration: 0.6 }}
              />
            </motion.button>
          </motion.div>
        </div>
      </div>

      {/* Animated underline */}
      <motion.div
        className="header-underline"
        initial={{ scaleX: 0 }}
        animate={{ scaleX: isScrolled ? 1 : 0 }}
        transition={{ duration: 0.3 }}
      />
    </motion.header>
  );
};

export default Header;
